import React from 'react'

const QuestionCategory = ({categories,quizCat }) => {
    return (
        <article>
            <ul className="quizCategorie">
                {categories.map((item, index) => {
                    return (
                        <li onClick = {quizCat} value={item} className="listItem" key={index}>{item}</li>
                    )
                })}
            </ul>
        </article>
    )
}
export default QuestionCategory;
